import "./setgame.css";
/* <!--Game Picture --> */
import pacman from "../../assets/LogoGame/pacman.png";
/* <!--Game Link --> */
import "./grid.css"

const Setgame = () => {
    return (
    <div className='game-container grid wide'>
        <div className='row'>
            <div className='col l-4'>
                <img className='game-avatar' src={pacman}/>
                <label className='game-label'/>
            </div>
        </div>
        
    </div>
          
    );
};
export default Setgame;
